import React, { useState, useEffect } from "react";
import axios from "axios";

const RestaurantDashboard = () => {
  const [orders, setOrders] = useState([]);
  const [restaurantData, setRestaurantData] = useState({ name: "", address: "", cuisine: "" });
  const [restaurants, setRestaurants] = useState([]); // Store added restaurants

  // Fetch Orders & Restaurants
  useEffect(() => {
    axios
      .get("http://localhost:5000/api/orders/restaurant-orders", { headers: { Authorization: localStorage.getItem("token") } })
      .then((res) => setOrders(res.data));

    axios
      .get("http://localhost:5000/api/restaurants") // Fetch restaurants
      .then((res) => setRestaurants(res.data));
  }, []);

  // Handle Input Changes
  const handleChange = (e) => {
    setRestaurantData({ ...restaurantData, [e.target.name]: e.target.value });
  };

  // Submit New Restaurant
  const addRestaurant = (e) => {
    e.preventDefault();
    axios.post(
      "http://localhost:5000/api/restaurants/add",
      restaurantData,
      { headers: { Authorization: localStorage.getItem("token") } }
    ).then((res) => {
      alert(res.data.message);
      setRestaurants([...restaurants, res.data.restaurant]); // Update UI
      setRestaurantData({ name: "", address: "", cuisine: "" }); // Clear form
    }).catch((err) => alert(err.response.data.message));
  };

  // Update Order Status
  const updateStatus = (orderId, status) => {
    axios.post(
      "http://localhost:5000/api/orders/update",
      { orderId, status },
      { headers: { Authorization: localStorage.getItem("token") } }
    ).then(() => {
      setOrders(orders.map(order => order._id === orderId ? { ...order, status } : order));
    });
  };

  return (
    <div>
      <h1>Restaurant Dashboard</h1>

      {/* 🛠 Add New Restaurant Form */}
      <h2>Add a New Restaurant</h2>
      <form onSubmit={addRestaurant}>
        <input type="text" name="name" placeholder="Restaurant Name" value={restaurantData.name} onChange={handleChange} required />
        <input type="text" name="address" placeholder="Address" value={restaurantData.address} onChange={handleChange} required />
        <input type="text" name="cuisine" placeholder="Cuisine Type" value={restaurantData.cuisine} onChange={handleChange} required />
        <button type="submit">Add Restaurant</button>
      </form>

      {/* 🏪 List of Restaurants */}
      <h2>Your Restaurants</h2>
      {restaurants.length === 0 ? <p>No restaurants added yet.</p> : (
        restaurants.map((r) => (
          <div key={r._id}>
            <h3>{r.name}</h3>
            <p>{r.address} - {r.cuisine}</p>
          </div>
        ))
      )}

      {/* 📦 Order Management */}
      <h2>Manage Orders</h2>
      {orders.length === 0 ? <p>No orders yet.</p> : (
        orders.map((order) => (
          <div key={order._id}>
            <h3>Order from {order.customer.name}</h3>
            <p>Status: {order.status}</p>
            <button onClick={() => updateStatus(order._id, "Preparing")}>Preparing</button>
            <button onClick={() => updateStatus(order._id, "Out for Delivery")}>Out for Delivery</button>
            <button onClick={() => updateStatus(order._id, "Delivered")}>Delivered</button>
          </div>
        ))
      )}
    </div>
  );
};

export default RestaurantDashboard;
